import Box from "./Box";

const PortfolioSection = ({title, titlePlacement, titleColor, text, children}) => {
    return (  
        <div className="row">
            <div className={titlePlacement === 'left' ? "row" : 'row-reverse'}>
                <div className="column">
                    <h2 className={titleColor==='red' ? "red" : "blue"}>{title}</h2>
                    <p>{text}</p>
                </div>
                <div className="column">
                    {children}
                </div>
            </div>
        </div>
    );
}

export default PortfolioSection;
